To find the minimum distance from the origin \((0,0)\) to the curve given by the equation \(y = \frac{1}{\sqrt{2}}(x^2 - 3)\), we need to minimize the distance function \(d = \sqrt{x^2 + y^2}\).

First, substitute the expression for \(y\) into the distance function:
\[d = \sqrt{x^2 + \left(\frac{1}{\sqrt{2}}(x^2 - 3)\right)^2}.\]
This simplifies to:
\[d = \sqrt{x^2 + \frac{1}{2}(x^2 - 3)^2} = \sqrt{x^2 + \frac{1}{2}(x^4 - 6x^2 + 9)} = \sqrt{\frac{1}{2}x^4 - 2x^2 + \frac{9}{2}}.\]
To minimize \(d\), we can minimize \(d^2\) instead:
\[d^2 = \frac{1}{2}x^4 - 2x^2 + \frac{9}{2}.\]
Let \(u = x^2\).  Then the function becomes:
\[f(u) = \frac{1}{2}u^2 - 2u + \frac{9}{2}.\]
To find the minimum value of \(f(u)\), we take the derivative and set it to zero:
\[f'(u) = u - 2 = 0 \implies u = 2.\]
So, \(x^2 = 2 \implies x = \pm \sqrt{2}\). Substituting \(u = 2\) back into \(f(u)\) gives:
\[f(2) = \frac{1}{2}(2)^2 - 2(2) + \frac{9}{2} = 2 - 4 + \frac{9}{2} = \frac{4 - 8 + 9}{2} = \frac{5}{2}.\]
Thus, the minimum distance \(d\) is:
\[d = \sqrt{\frac{5}{2}} = \frac{\sqrt{10}}{2}.\]
Therefore, \(a = 10\) and \(b = 2\), so \(a + b = 10 + 2 = 12\).

